import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img
        src={props.img}
        alt="avatar_img"
      />
      <p>{props.tel}</p>
      <p>b@beyonce.com</p>
    </div>
  );
}

ReactDOM.render(
  <div>
  <h1>Contacts</h1>
  <Card  name="girl"  img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"  tel="123"



  />
  </div>,
  document.getElementById("root")
);
